// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract LendingContract {
    struct Loan {
        uint256 amount;
        bool active;
    }

    mapping(address => Loan) public loans;

    // Lend Function
    function lend() public payable {
        require(msg.value > 0, "You must lend some ETH");
        loans[msg.sender] = Loan({
            amount: msg.value,
            active: true
        });
    }

    // Borrow Function
    function borrow(uint256 amount) public {
        require(amount > 0, "Amount must be greater than 0");
        require(loans[msg.sender].active, "You must lend before borrowing");
        require(loans[msg.sender].amount >= amount, "Insufficient balance to borrow");

        // Update loan status
        loans[msg.sender].amount -= amount;

        // Transfer borrowed amount
        payable(msg.sender).transfer(amount);
    }

    // Get loan status
    function getLoanStatus(address borrower) public view returns (uint256, bool) {
        return (loans[borrower].amount, loans[borrower].active);
    }
}

